import Portfolio from "./components/Portfolio";
import About from "./components/About";
import Contact from "./components/Contact";
import Header from "./components/Header";
import "./App.css";
import tree from "./assets/tree.png";
import cloud1 from "./assets/cloud1.png";
import cloud2 from "./assets/cloud2.png";
import cloud3 from "./assets/cloud3.png";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          {/* <span class="redCircle"></span>
          <hr className="solid1"></hr>
          <hr className="solid2"></hr>
          <hr className="solid3"></hr>
          <hr className="solid4"></hr>
          <hr className="solid5"></hr>
          <img src={tree} alt="Tree" class="tree" />
          <hr className="solidBase"></hr> */}
          {/* <img src={cloud1} alt="Tree" class="cloud1" />
          <img src={cloud2} alt="Tree" class="cloud2" />
          <img src={cloud3} alt="Tree" class="cloud3" /> */}
          <Tree />
          <Routes>
            <Route exact path="/portfolio" element={<Portfolio />} />
            <Route exact path="/about" element={<About />} />
            <Route exact path="/contact" element={<Contact />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
